	(97, 1, 'Mac Book Air', 'The MacBook family is a range of Macintosh notebook computers by Apple Inc. that merged the PowerBook and iBook lines during Apple\'s transition to Intel processors. The first model released under this family was the MacBook Pro, which was announced on January 10, 2006, at the Macworld Expo. The consumer-focused MacBook was released on May 16, 2006, and the MacBook Air was revealed on January 15, 2008. As of July 20, 2011, the unibody MacBook has been discontinued for consumer sales.[1]', '', '', ''),
